//O arquivo index.js é o ponto de entrada da aplicação no nível do JavaScript.
//É onde o React é utilizado para renderizar o componente principal (App) na DOM.
//Além disso, o React.StrictMode é envolvido em torno do App para detectar
// possíveis problemas na sua aplicação durante o desenvolvimento.

//Importa o React e a API ReactDOM da biblioteca React, necessários para renderizar os componentes React na DOM.
import React from 'react';
import ReactDOM from 'react-dom/client';

//Importa o arquivo de estilos CSS global.
import './index.css';

//Importa o componente principal da aplicação (App.js).
import App from './App';

//Criação da raiz React através da função createRoot, e obtém o elemento DOM com o ID root (<div> de id "root" do HTML.
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
